(169, '14', 'KOUROUMAKARIM_photo_1691067679.jpeg', 'KOUROUMA', 'KARIM', '30/08/1998', 'KISSIDOUGOU', 1, '12', 'ECONOMISTE', 'KOUROUMAKARIM_dip_1691067679.pdf', NULL, 'kouroumaa589@gmail.com', '+224 623-55-21-26', 'MORY CONDE', '+224 624-16-51-92', '', '', '3', '1', '4', 'KOUROUMAKARIM_cv_1691067679.pdf', 'KOUROUMAKARIM_cni_1691067679.jpeg', 'CARTO', 'Y411B', 0, '2023-08-03 13:01:19', NULL, '', '', '', '', '', '', '26', '2601', 1, 1, 1, 'KOUROUMAKARIM_cnituteur_1691067679.jpeg', 1, '1', 1, 'cni', '3130082420000036', 'MAMOUDOU KOUROUMA', 'FANTA CONDE', 1, 'USAID', '2010', 'Superviseur', 'Paludismes', '03/08/2023', 1, NULL, 0, 0, 'AGENT DE COLLECTE DE LA CARTOGRAPHIE CENSITAIRE PILOTE', 'CARTOGRAPHE', '14', NULL, NULL, 0, 0.00, 0, 0, '2023-08-30 09:30:40', 0, '2023-08-30 09:30:40', 0),
(170, '14', 'CAMARAIBRAHIMASORY_photo_1691101275.jpeg', 'CAMARA', 'IBRAHIMA SORY', '30/10/1999', 'CONAKRY', 1, '12', 'ECONOMIE FINANCE', 'CAMARAIBRAHIMASORY_dip_1691101275.jpeg', NULL, 'ibrahimasoryogcamara@gmail.com', '+224 610-53-44-93', 'SEKOU OUMAR YANSANE', '+224 624-34-22-31', 'MAMADAMA SYLLA', '+224 660-23-60-80', '1', '3', '2', 'CAMARAIBRAHIMASORY_cv_1691101275.pdf', 'CAMARAIBRAHIMASORY_cni_1691101275.jpeg', 'CARTO', '7NWL8', 0, '2023-08-03 22:21:15', NULL, '', '', '', '', '', '', '25', '2501', 1, 1, 1, 'CAMARAIBRAHIMASORY_cnituteur_1691101275.jpeg', 1, '1', 1, 'cni', '020104010124069', 'MOHAMED CAMARA', 'MAMADAMA SYLLA', 2, '', '2023', '', '', '30/08/2023', 1, NULL, 0, 0, 'AGENT DE COLLECTE DE LA CARTOGRAPHIE CENSITAIRE PILOTE', 'CARTOGRAPHE', '14', NULL, NULL, 0, 0.00, 0, 0, '2023-08-30 09:30:40', 0, '2023-08-30 09:30:40', 0);
INSERT INTO `recrut_projet` (`id`, `Codeprojet`, `NomProjet`, `SigleProjet`, `Datedebut`, `Datefin`, `ChefProjet`, `Contact1chefprojet`, `Contact2chefprojet`, `Emailchefprojet`, `id_nivo_minimum`, `libelle_nivo_minimum`, `active`, `description`, `type_projet`, `piece_fourni`, `titre_poste`, `nbrdisponible`, `contrat`, `attestationhonneur`, `is_collecte`, `nbrinsert`, `nbr_limit`) VALUES
(12, 'GEO', 'TECHNICIEN LABORATOIRE CARTOGRAPHIE', 'RGPH4', '19-07-2023', '2024-08-22', 'GUINEE', '22334455', '', 0, 12, 'BAC +2', 1, '<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p style=\"text-align: justify;\">Dans le cadre de la r&eacute;alisation des activit&eacute;s de terrain de la cartographie censitaire du Recensement G&eacute;n&eacute;ral de la Population et de l&rsquo;Habitat (2023), l&lsquo;Institut National de la Statistique (INS) de Guinée recrute <strong>********</strong> <strong>****</strong> (<strong>****) Géomaticiens</strong></p>\n</body>\n</html>', 1, '<!DOCTYPE html>\r\n<html>\r\n\r\n<head>\r\n    <title></title>\r\n</head>\r\n\r\n<body>\r\n    <p><strong>&nbsp;I. PROFIL DU CANDIDAT AUX POSTES</strong></p>\r\n    <p><strong>&nbsp;</strong></p>\r\n    <ul>\r\n        <li>&ecirc;tre Guin&eacute;en ;</li>\r\n        <li>&ecirc;tre &acirc;g&eacute; de 18 ans au minimum et de 45 ans au maximum, au moment du d&eacute;p&ocirc;t du dossier de candidature&nbsp;;</li>\r\n        <li>avoir un niveau minimum de la classe de Terminal dans l&rsquo;enseignement g&eacute;n&eacute;ral ou technique&nbsp;;</li>\r\n        <li>savoir utiliser une tablette informatique&nbsp;;</li>\r\n        <li>&ecirc;tre en bonne sant&eacute; physique, mentale et intellectuelle&nbsp;;</li>\r\n        <li>&ecirc;tre capable de travailler en &eacute;quipe et sous pression&nbsp;;</li>\r\n        <li>avoir une exp&eacute;rience en collecte de donn&eacute;es est un atout&nbsp;;</li>\r\n        <li>savoir aller &agrave; mobylette est obligatoire&nbsp;;</li>\r\n        <li>Avoir des aptitudes &agrave; communiquer ;&nbsp;</li>\r\n        <li>Avoir une connaissance des langues locales serait un atout&nbsp;;</li>\r\n        <li>Avoir un compte mobile money (MTN, Orange) ;</li>\r\n        <li>poss&eacute;der les qualit&eacute;s suivantes&nbsp;:</li>\r\n    </ul>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &nbsp;&ecirc;tre de bonne moralit&eacute;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir un bon sens des relations humaines ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &ecirc;tre discret ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir un sens de l&rsquo;organisation et l&rsquo;esprit d&rsquo;analyse ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &ecirc;tre dynamique, rigoureux, disponible et ponctuel ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir le respect de la hi&eacute;rarchie.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>II. &nbsp;DUR&Eacute;E DU CONTRAT ET LIEU D&rsquo;EXERCICE DE LA FONCTION :</strong></p>\r\n    <p><strong><em>&nbsp;</em></strong></p>\r\n    <p>La dur&eacute;e du contrat est de **** mois . Le candidat doit s&rsquo;assurer de sa disponibilit&eacute; sur la p&eacute;riode indiqu&eacute;e.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>III. &nbsp; DOSSIER DE CANDIDATURE</strong></p>\r\n    <p style=\"text-align: justify;\">&nbsp;Les candidats devront s&rsquo;inscrire sur le site de recrutement en ligne de l&rsquo;INS &agrave; l&rsquo;adresse suivante : ***********************</p>\r\n    <p style=\"text-align: justify;\">&nbsp;Le dossier de candidature devra &ecirc;tre t&eacute;l&eacute;charg&eacute; sur le site de recrutement et comprendra les documents suivants :</p>\r\n    <ul>\r\n        <li>Un curriculum vitae faisant ressortir la qualification et l&rsquo;exp&eacute;rience professionnelle de l&rsquo;int&eacute;ress&eacute; (format PDF)&nbsp;;</li>\r\n        <li>Une photocopie du dipl&ocirc;me (format PDF ou JPG)&nbsp;;</li>\r\n        <li>Une photocopie d&rsquo;une pi&egrave;ce d&rsquo;identit&eacute; (format PDF ou JPG)&nbsp;;</li>\r\n        <li>Une photo d&rsquo;identit&eacute; (JPG)&nbsp;;</li>\r\n    </ul>\r\n    <p>&nbsp;</p>\r\n    <p><strong>N.B&nbsp;: Taille des fichiers&nbsp;: Maximum 2 Mo.</strong></p>\r\n    <p>&nbsp;</p>\r\n    <p>&nbsp;<strong>IV. DATE D&rsquo;INSCRIPTION SUR LE SITE DE RECRUTEMENT</strong></p>\r\n    <p>Les dossiers de candidature doivent &ecirc;tre post&eacute;s sur le site de recrutement du <strong>****************</strong>, &agrave; minuit d&eacute;lai de rigueur. L&rsquo;heure de l&rsquo;enregistrement sur le site faisant foi.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>NB: Seuls les candidats pr&eacute;s&eacute;lectionn&eacute;s seront contact&eacute;s</strong>.</p>\r\n    <p>&nbsp;</p>\r\n</body>\r\n\r\n</html>', 'GEOMATICIEN', '15', '<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">REPUBLIQUE DE GUINEE</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">MINISTERE DU PLAN ET DE LA COOPERATION INTERNATIONALE&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\"><img src=\"data:image/png;base64,\" width=\"606\" height=\"80\"></span><br></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><span style=\"font-family: -webkit-standard, serif;color: black;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></strong><em><span style=\"font-family: -webkit-standard, serif;color: black;\">Conakry, le</span></em></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">AVIS DE RECRUTEMENT DES AGENTS DE TERRAIN DE LA CARTOGRAPHIE PILOTE</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">Contexte&nbsp;</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">La mise en &oelig;uvre de la cartographie censitaire du RGPH-4 en R&eacute;publique de Guin&eacute;e n&eacute;cessite un personnel comp&eacute;tent de profil vari&eacute;. Ce personnel comprend, d&rsquo;une part le personnel d&rsquo;encadrement pour la conception m&eacute;thodologique, la coordination et le suivi des travaux et, d&rsquo;autre part, le personnel d&rsquo;ex&eacute;cution pour les travaux de laboratoire et le personnel du terrain. Pour avoir cet effectif n&eacute;cessaire, un recrutement par appel &agrave; candidature ouvert sera lanc&eacute;. Les candidats qui seront retenus seront form&eacute;s pour bien accomplir les missions qui leur seront assign&eacute;es</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Le personnel qui sera impliqu&eacute; dans les travaux de terrain sera class&eacute; en deux grandes cat&eacute;gories :</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Le personnel d&rsquo;encadrement de terrain</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Le personnel de collecte&nbsp;&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">Objectif de l&rsquo;activit&eacute;</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Les travaux de la cartographie de terrain est une phase importante dans la r&eacute;alisation de la cartographie censitaire digitale. Le personnel en charge de ces travaux aura pour mission&nbsp;:</span></p>\r\n<ul style=\"list-style-type: undefined;margin-left:44px;\">\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Contacter les autorit&eacute;s administratives et locales et les informer de l&rsquo;op&eacute;ration de la cartographie censitaire et obtenir leur coop&eacute;ration ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Mettre &agrave; jour les fonds de cartes (limite administratives, r&eacute;seau routier, hydrographique, &hellip;) ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">V&eacute;rifier et actualiser au besoin le fichier de localit&eacute;&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Administrer le questionnaire communautaire au chef de village et de quartier&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Proc&eacute;der aux lev&eacute;s des coordonn&eacute;es g&eacute;ographiques des localit&eacute;s et infrastructures socio-collectifs de base&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Identifier et g&eacute;olocaliser toutes les concessions dans chaque ilot et localit&eacute; ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Faire le listing des m&eacute;nages de chaque concession et estimer la population&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Proposer un d&eacute;coupage des communes/ sous-pr&eacute;fecture en ZD sur la carte papier&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Proposer la composition des ZD sur tablette&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Transf&eacute;rer les donn&eacute;es collect&eacute;es au serveur central suivant de protocole de transfert de donn&eacute;e qui sera d&eacute;fini.</span></li>\r\n</ul>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">Le personnel de collecte</span></u></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">Les chefs d&rsquo;&eacute;quipe</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Ce sont des responsables techniques en mati&egrave;re de collecte des donn&eacute;es cartographiques choisis en raison de leur connaissance du terrain. Ils disposeront, chacun d&rsquo;une tablette de haute capacit&eacute; sur laquelle des applications sp&eacute;cifiques seront d&eacute;velopp&eacute;es pour recevoir les donn&eacute;es de son &eacute;quipe et contr&ocirc;ler l&rsquo;exhaustivit&eacute; et d&rsquo;&eacute;dition primaire avant de transf&eacute;rer les donn&eacute;es collect&eacute;es au serveur central. Il aura en charge trois agents cartographes.&nbsp;&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">Agent cartographe&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Les agents cartographes travailleront sous la responsabilit&eacute; des chefs d&rsquo;&eacute;quipe. Ils sont le maillon essentiel de la chaine en termes de qualit&eacute; des donn&eacute;es collect&eacute;es.</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 13.8pt;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Dans le cadre de la r&eacute;alisation du Recensement G&eacute;n&eacute;ral de la Population et de l&rsquo;Habitat</span><span style=\"font-family: Arial, sans-serif;color: black;\">ion</span><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;(RGPH-4), l&lsquo;Institut National de la Statistique (INS) de Guin&eacute;e, &agrave; travers le Bureau Central du Recensement (BCR), recrute quarante-cinq (45) agents de collecte pour la cartographie pilote.</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 13.8pt;;\"><strong><span style=\'font-size:9px;font-family: \"Trebuchet MS\", sans-serif;color: black;\'>&nbsp;</span></strong></p>\r\n<ol start=\"1\" type=\"1\" style=\"margin-bottom: 0cm;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;margin-top: 0cm;\">\r\n    <li style=\'margin:0cm;font-size:16px;font-family:\"Calibri\",sans-serif;color:black;text-align:justify;line-height:150%;background:white;\'><strong><span style=\"font-family: Arial, sans-serif;\">PROFIL DU CANDIDAT</span></strong></li>\r\n</ol>\r\n<ul style=\"list-style-type: disc;margin-left:72.05px;\">\r\n    <li><span lang=\"ZH-CN\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre de nationalit&eacute; guin&eacute;enne ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre &acirc;g&eacute; de 18 ans au minimum et de 45 ans au maximum, au moment du d&eacute;p&ocirc;t du dossier de candidature&nbsp;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">BAC+3 ou plus dans les sp&eacute;cialit&eacute;s telles que la g&eacute;omatique, la cartographie, la g&eacute;ographie, l&rsquo;am&eacute;nagement du territoire ou toute autre sp&eacute;cialit&eacute; connexe mais avec une bonne exp&eacute;rience av&eacute;r&eacute;e dans les enqu&ecirc;tes statistiques.</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre en bonne sant&eacute; physique, mentale et intellectuelle&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre capable de travailler en &eacute;quipe et sous pression&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir des aptitudes &agrave; communiquer couramment en fran&ccedil;ais et au moins dans une langue locale ;&nbsp;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre de bonne moralit&eacute;&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir un bon sens des relations humaines ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir le respect du secret professionnel ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir un sens de l&rsquo;organisation et l&rsquo;esprit d&rsquo;analyse&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre dynamique, rigoureux, disponible et ponctuel ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre capable et disponible de travailler en milieu rural sous diff&eacute;rentes intemp&eacute;ries</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre capable de r&eacute;diger un rapport.</span></li>\r\n</ul>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<ol start=\"1\" type=\"1\" style=\"margin-bottom: 0cm;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;margin-top: 0cm;\">\r\n    <li style=\'margin:0cm;font-size:16px;font-family:\"Calibri\",sans-serif;color:black;line-height:150%;;\'><strong><span style=\"font-family: Arial, sans-serif;\">DATE ET LIEU DE DEP&Ocirc;T DES DOSSIERS DE CANDIDATURES&nbsp;</span></strong></li>\r\n</ol>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Le dossier de candidature devra &ecirc;tre scann&eacute; et envoy&eacute; sur le site de recrutement en ligne du <strong>RGPH-4</strong> &agrave; l&apos;adresse suivante :&nbsp;</span><span style=\"color: black;\"><a href=\"https://recrutement.rp2020.ci/\"><span style=\"font-family: Arial, sans-serif;color: blue;\">***************</span></a></span><span style=\"font-family: Arial, sans-serif;color: rgb(46, 116, 181);\">&nbsp;.&nbsp;</span><span style=\"font-family: Arial, sans-serif;color: black;\">La date limite du d&eacute;p&ocirc;t des dossiers est fix&eacute;e pour&nbsp;&nbsp;le&nbsp;<strong>***************, &agrave; minuit d&eacute;lai de rigueur.</strong> L&rsquo;heure de l&rsquo;enregistrement sur les sites faisant foi.</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Seuls les candidats pr&eacute;s&eacute;lectionn&eacute;s seront contact&eacute;s</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">NB: AUCUN FRAIS DE DOSSIERS N&rsquo;EST EXIGE</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">Contact: ***************</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">   <br> </p> <p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Madame, Monsieur,</p> <p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">   <br> </p> <p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Je soussigné(e) Madame/Mademoiselle/Monsieur (<div id=\"namesurname\">prénom nom</div>), atteste sur l\'honneur que je ne souffre d’aucune maladie invalidante qui pourrait entraver le travail durant 30 jours à compter du premier jour.</p> <p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left:0cm;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Les sanctions encourues sont&nbsp;:</p> <p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>arrêt immédiat du travail, donc &nbsp;la rupture de contrat ;</p> <p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>remboursement des jours de travail non effectués&nbsp;;</p> <p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>remboursement des frais de transport et de formation.</p> <p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">&nbsp;</p> <p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left:0cm;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">J\'ai pris connaissance des sanctions encourues.&nbsp;</p> <p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">&nbsp;</p> <p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Fait pour servir et valoir ce que de droit.&nbsp;</p> <p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><em>&nbsp;</em></p> <p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><em>(lieu), le (date)&nbsp;</em></p>', 0, 0, 500);
INSERT INTO `recrut_projet` (`id`, `Codeprojet`, `NomProjet`, `SigleProjet`, `Datedebut`, `Datefin`, `ChefProjet`, `Contact1chefprojet`, `Contact2chefprojet`, `Emailchefprojet`, `id_nivo_minimum`, `libelle_nivo_minimum`, `active`, `description`, `type_projet`, `piece_fourni`, `titre_poste`, `nbrdisponible`, `contrat`, `attestationhonneur`, `is_collecte`, `nbrinsert`, `nbr_limit`) VALUES
(13, 'AP', 'RGPH 4 - AGENT PREPARATEUR', 'RGPH4', '16-07-2023', '2024-08-22', 'GUINEE', '22334455', '', 0, 10, 'BAC +2', 1, '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\">Dans le cadre de la r&eacute;alisation des activit&eacute;s de terrain de la cartographie censitaire du Recensement G&eacute;n&eacute;ral de la Population et de l&rsquo;Habitat (2023), l&lsquo;Institut National de la Statistique (INS) de Guinée recrute <strong>********</strong> <strong>****</strong> (<strong>****) Agents Préparateurs</strong></p>\r\n</body>\r\n</html>', 1, '<!DOCTYPE html>\r\n<html>\r\n\r\n<head>\r\n    <title></title>\r\n</head>\r\n\r\n<body>\r\n    <p><strong>&nbsp;I. PROFIL DU CANDIDAT AUX POSTES</strong></p>\r\n    <p><strong>&nbsp;</strong></p>\r\n    <ul>\r\n        <li>&ecirc;tre Guin&eacute;en ;</li>\r\n        <li>&ecirc;tre &acirc;g&eacute; de 18 ans au minimum et de 45 ans au maximum, au moment du d&eacute;p&ocirc;t du dossier de candidature&nbsp;;</li>\r\n        <li>avoir un niveau minimum de la classe de Terminal dans l&rsquo;enseignement g&eacute;n&eacute;ral ou technique&nbsp;;</li>\r\n        <li>savoir utiliser une tablette informatique&nbsp;;</li>\r\n        <li>&ecirc;tre en bonne sant&eacute; physique, mentale et intellectuelle&nbsp;;</li>\r\n        <li>&ecirc;tre capable de travailler en &eacute;quipe et sous pression&nbsp;;</li>\r\n        <li>avoir une exp&eacute;rience en collecte de donn&eacute;es est un atout&nbsp;;</li>\r\n        <li>savoir aller &agrave; mobylette est obligatoire&nbsp;;</li>\r\n        <li>Avoir des aptitudes &agrave; communiquer ;&nbsp;</li>\r\n        <li>Avoir une connaissance des langues locales serait un atout&nbsp;;</li>\r\n        <li>Avoir un compte mobile money (MTN, Orange) ;</li>\r\n        <li>poss&eacute;der les qualit&eacute;s suivantes&nbsp;:</li>\r\n    </ul>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &nbsp;&ecirc;tre de bonne moralit&eacute;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir un bon sens des relations humaines ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &ecirc;tre discret ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir un sens de l&rsquo;organisation et l&rsquo;esprit d&rsquo;analyse ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &ecirc;tre dynamique, rigoureux, disponible et ponctuel ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir le respect de la hi&eacute;rarchie.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>II. &nbsp;DUR&Eacute;E DU CONTRAT ET LIEU D&rsquo;EXERCICE DE LA FONCTION :</strong></p>\r\n    <p><strong><em>&nbsp;</em></strong></p>\r\n    <p>La dur&eacute;e du contrat est de **** mois . Le candidat doit s&rsquo;assurer de sa disponibilit&eacute; sur la p&eacute;riode indiqu&eacute;e.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>III. &nbsp; DOSSIER DE CANDIDATURE</strong></p>\r\n    <p style=\"text-align: justify;\">&nbsp;Les candidats devront s&rsquo;inscrire sur le site de recrutement en ligne de l&rsquo;INS &agrave; l&rsquo;adresse suivante : ***********************</p>\r\n    <p style=\"text-align: justify;\">&nbsp;Le dossier de candidature devra &ecirc;tre t&eacute;l&eacute;charg&eacute; sur le site de recrutement et comprendra les documents suivants :</p>\r\n    <ul>\r\n        <li>Un curriculum vitae faisant ressortir la qualification et l&rsquo;exp&eacute;rience professionnelle de l&rsquo;int&eacute;ress&eacute; (format PDF)&nbsp;;</li>\r\n        <li>Une photocopie du dipl&ocirc;me (format PDF ou JPG)&nbsp;;</li>\r\n        <li>Une photocopie d&rsquo;une pi&egrave;ce d&rsquo;identit&eacute; (format PDF ou JPG)&nbsp;;</li>\r\n        <li>Une photo d&rsquo;identit&eacute; (JPG)&nbsp;;</li>\r\n    </ul>\r\n    <p>&nbsp;</p>\r\n    <p><strong>N.B&nbsp;: Taille des fichiers&nbsp;: Maximum 2 Mo.</strong></p>\r\n    <p>&nbsp;</p>\r\n    <p>&nbsp;<strong>IV. DATE D&rsquo;INSCRIPTION SUR LE SITE DE RECRUTEMENT</strong></p>\r\n    <p>Les dossiers de candidature doivent &ecirc;tre post&eacute;s sur le site de recrutement du <strong>****************</strong>, &agrave; minuit d&eacute;lai de rigueur. L&rsquo;heure de l&rsquo;enregistrement sur le site faisant foi.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>NB: Seuls les candidats pr&eacute;s&eacute;lectionn&eacute;s seront contact&eacute;s</strong>.</p>\r\n    <p>&nbsp;</p>\r\n</body>\r\n\r\n</html>', 'AGENT PREPARATEUR', '15', '<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">REPUBLIQUE DE GUINEE</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">MINISTERE DU PLAN ET DE LA COOPERATION INTERNATIONALE&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\"><img src=\"data:image/png;base64,\" width=\"606\" height=\"80\"></span><br></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><span style=\"font-family: -webkit-standard, serif;color: black;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></strong><em><span style=\"font-family: -webkit-standard, serif;color: black;\"></span></em></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">AVIS DE RECRUTEMENT DES AGENTS DE TERRAIN DE LA CARTOGRAPHIE PILOTE</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">Contexte&nbsp;</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Dans le cadre du quatrième Recensement Général de la Population et de l’Habitation (RGPH-4), l’Institut National de la Statistique, à travers le Bureau Central du Recensement (BCR), recrute trente-huit (38) agents de collecte, en vue de la réalisation de la cartographie censitaire pilote. \r\nLa collecte des données de la cartographie censitaire pilote se déroulera dans les sous-préfectures et communes urbaines suivantes :\r\n</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Commune urbaine de Matam (Conakry) ;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Commune urbaine de Koubia (Koubia) ;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Sous-préfecture de Kiniero (Kouroussa) ;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Sous-préfecture de Fangamandou (Gueckedou) ;&nbsp;&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;-	Sous-préfecture de Koba (Boffa). ;&nbsp;&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">Objectif de l&rsquo;activit&eacute;</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Les travaux de la cartographie de terrain est une phase importante dans la r&eacute;alisation de la cartographie censitaire digitale. Le personnel en charge de ces travaux aura pour mission&nbsp;:</span></p>\r\n<ul style=\"list-style-type: undefined;margin-left:44px;\">\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Contacter les autorit&eacute;s administratives et locales et les informer de l&rsquo;op&eacute;ration de la cartographie censitaire et obtenir leur coop&eacute;ration ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Mettre &agrave; jour les fonds de cartes (limite administrative, r&eacute;seau routier, hydrographique, &hellip;) ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">V&eacute;rifier et actualiser au besoin le fichier de localit&eacute;&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Administrer le questionnaire communautaire au chef de village et de quartier&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Proc&eacute;der aux lev&eacute;s des coordonn&eacute;es g&eacute;ographiques des localit&eacute;s et infrastructures socio-collectifs de base&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Identifier et g&eacute;olocaliser toutes les concessions dans chaque ilot et localit&eacute; ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Faire le listing des m&eacute;nages de chaque concession et estimer la population&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Proposer un d&eacute;coupage des communes/ sous-pr&eacute;fecture en ZD sur la carte papier&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Proposer la composition des ZD sur tablette&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Transf&eacute;rer les donn&eacute;es collect&eacute;es au serveur central suivant de protocole de transfert de donn&eacute;e qui sera d&eacute;fini.</span></li>\r\n</ul>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">Le personnel de collecte</span></u></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">Les chefs d&rsquo;&eacute;quipe</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Ce sont des responsables techniques en mati&egrave;re de collecte des donn&eacute;es cartographiques choisis en raison de leur connaissance du terrain. Ils disposeront, chacun d&rsquo;une tablette de haute capacit&eacute; sur laquelle des applications sp&eacute;cifiques seront d&eacute;velopp&eacute;es pour recevoir les donn&eacute;es de son &eacute;quipe et contr&ocirc;ler l&rsquo;exhaustivit&eacute; et d&rsquo;&eacute;dition primaire avant de transf&eacute;rer les donn&eacute;es collect&eacute;es au serveur central. Il aura en charge trois agents cartographes.&nbsp;&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">Agent cartographe&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Les agents cartographes travailleront sous la responsabilit&eacute; des chefs d&rsquo;&eacute;quipe. Ils sont le maillon essentiel de la chaine en termes de qualit&eacute; des donn&eacute;es collect&eacute;es.</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 13.8pt;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Dans le cadre de la r&eacute;alisation du Recensement G&eacute;n&eacute;ral de la Population et de l&rsquo;Habitat</span><span style=\"font-family: Arial, sans-serif;color: black;\">ion</span><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;(RGPH-4), l&lsquo;Institut National de la Statistique (INS) de Guin&eacute;e, &agrave; travers le Bureau Central du Recensement (BCR), recrute quarante-cinq (45) agents de collecte pour la cartographie pilote.</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 13.8pt;;\"><strong><span style=\'font-size:9px;font-family: \"Trebuchet MS\", sans-serif;color: black;\'>&nbsp;</span></strong></p>\r\n<ol start=\"1\" type=\"1\" style=\"margin-bottom: 0cm;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;margin-top: 0cm;\">\r\n    <li style=\'margin:0cm;font-size:16px;font-family:\"Calibri\",sans-serif;color:black;text-align:justify;line-height:150%;\'><strong><span style=\"font-family: Arial, sans-serif;\">PROFIL DU CANDIDAT</span></strong></li>\r\n</ol>\r\n<ul style=\"list-style-type: disc;margin-left:72.05px;\">\r\n    <li><span lang=\"ZH-CN\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre de nationalit&eacute; guin&eacute;enne ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre &acirc;g&eacute; de 18 ans au minimum et de 45 ans au maximum, au moment du d&eacute;p&ocirc;t du dossier de candidature&nbsp;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">BAC+3 ou plus dans les sp&eacute;cialit&eacute;s telles que la g&eacute;omatique, la cartographie, la g&eacute;ographie, l&rsquo;am&eacute;nagement du territoire ou toute autre sp&eacute;cialit&eacute; connexe mais avec une bonne exp&eacute;rience av&eacute;r&eacute;e dans les enqu&ecirc;tes statistiques.</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre en bonne sant&eacute; physique, mentale et intellectuelle&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre capable de travailler en &eacute;quipe et sous pression&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir des aptitudes &agrave; communiquer couramment en fran&ccedil;ais et au moins dans une langue locale ;&nbsp;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre de bonne moralit&eacute;&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir un bon sens des relations humaines ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir le respect du secret professionnel ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir un sens de l&rsquo;organisation et l&rsquo;esprit d&rsquo;analyse&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre dynamique, rigoureux, disponible et ponctuel ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre capable et disponible de travailler en milieu rural sous diff&eacute;rentes intemp&eacute;ries</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre capable de r&eacute;diger un rapport.</span></li>\r\n</ul>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<ol start=\"1\" type=\"1\" style=\"margin-bottom: 0cm;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;margin-top: 0cm;\">\r\n    <li style=\'margin:0cm;font-size:16px;font-family:\"Calibri\",sans-serif;color:black;line-height:150%;;\'><strong><span style=\"font-family: Arial, sans-serif;\">DATE ET LIEU DE DEP&Ocirc;T DES DOSSIERS DE CANDIDATURES&nbsp;</span></strong></li>\r\n</ol>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Le dossier de candidature devra &ecirc;tre scann&eacute; et envoy&eacute; sur le site de recrutement en ligne du <strong>RGPH-4</strong> &agrave; l&apos;adresse suivante :&nbsp;</span><span style=\"color: black;\"><a href=\"https://rgph.gov.gn\"><span style=\"font-family: Arial, sans-serif;color: blue;\">https://rgph.gov.gn</span></a></span><span style=\"font-family: Arial, sans-serif;color: rgb(46, 116, 181);\">&nbsp;.&nbsp;</span><span style=\"font-family: Arial, sans-serif;color: black;\">La date limite du d&eacute;p&ocirc;t des dossiers est fix&eacute;e pour&nbsp;&nbsp;le&nbsp;<strong>17/07/2023, &agrave; minuit d&eacute;lai de rigueur.</strong> L&rsquo;heure de l&rsquo;enregistrement sur les sites faisant foi.</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Seuls les candidats pr&eacute;s&eacute;lectionn&eacute;s seront contact&eacute;s</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">NB: AUCUN FRAIS DE DOSSIERS N&rsquo;EST EXIGE</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">Contact: +224 627 876 021/+224 661 311 175/+224 629 086 653</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">\r\n  <br>\r\n</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Madame, Monsieur,</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">\r\n  <br>\r\n</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Je soussigné(e) Madame/Mademoiselle/Monsieur (<div id=\"namesurname\">prénom nom</div>), atteste sur l\'honneur que je ne souffre d’aucune maladie invalidante qui pourrait entraver le travail durant 30 jours à compter du premier jour.</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left:0cm;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Les sanctions encourues sont&nbsp;:</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>arrêt immédiat du travail, donc &nbsp;la rupture de contrat ;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>remboursement des jours de travail non effectués&nbsp;;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>remboursement des frais de transport et de formation.</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left:0cm;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">J\'ai pris connaissance des sanctions encourues.&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Fait pour servir et valoir ce que de droit.&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><em>&nbsp;</em></p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><em>(lieu), le (date)&nbsp;</em></p>', 0, 0, 500);
INSERT INTO `recrut_projet` (`id`, `Codeprojet`, `NomProjet`, `SigleProjet`, `Datedebut`, `Datefin`, `ChefProjet`, `Contact1chefprojet`, `Contact2chefprojet`, `Emailchefprojet`, `id_nivo_minimum`, `libelle_nivo_minimum`, `active`, `description`, `type_projet`, `piece_fourni`, `titre_poste`, `nbrdisponible`, `contrat`, `attestationhonneur`, `is_collecte`, `nbrinsert`, `nbr_limit`) VALUES
(14, 'CARTO', 'AGENT DE COLLECTE DE LA CARTOGRAPHIE CENSITAIRE PILOTE', 'RGPH4', '16-07-2023', '2024-08-22', 'GUINEE', '22334455', '', 0, 11, 'BAC +2', 1, '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p style=\"text-align: justify;\">Dans le cadre de la r&eacute;alisation des activit&eacute;s de terrain de la cartographie censitaire du Recensement G&eacute;n&eacute;ral de la Population et de l&rsquo;Habitat (2023), l&lsquo;Institut National de la Statistique (INS) de Guinée recrute <strong>********</strong> <strong>****</strong> (<strong>****) chefs d&rsquo;&eacute;quipe</strong> et <strong>************ agents cartographes.</strong></p>\r\n</body>\r\n</html>', 1, '<!DOCTYPE html>\r\n<html>\r\n\r\n<head>\r\n    <title></title>\r\n</head>\r\n\r\n<body>\r\n    <p><strong>&nbsp;I. PROFIL DU CANDIDAT AUX POSTES</strong></p>\r\n    <p><strong>&nbsp;</strong></p>\r\n    <ul>\r\n        <li>&ecirc;tre Guin&eacute;en ;</li>\r\n        <li>&ecirc;tre &acirc;g&eacute; de 18 ans au minimum et de 45 ans au maximum, au moment du d&eacute;p&ocirc;t du dossier de candidature&nbsp;;</li>\r\n        <li>avoir un niveau minimum de la classe de Terminal dans l&rsquo;enseignement g&eacute;n&eacute;ral ou technique&nbsp;;</li>\r\n        <li>savoir utiliser une tablette informatique&nbsp;;</li>\r\n        <li>&ecirc;tre en bonne sant&eacute; physique, mentale et intellectuelle&nbsp;;</li>\r\n        <li>&ecirc;tre capable de travailler en &eacute;quipe et sous pression&nbsp;;</li>\r\n        <li>avoir une exp&eacute;rience en collecte de donn&eacute;es est un atout&nbsp;;</li>\r\n        <li>savoir aller &agrave; mobylette est obligatoire&nbsp;;</li>\r\n        <li>Avoir des aptitudes &agrave; communiquer ;&nbsp;</li>\r\n        <li>Avoir une connaissance des langues locales serait un atout&nbsp;;</li>\r\n        <li>Avoir un compte mobile money (MTN, Orange) ;</li>\r\n        <li>poss&eacute;der les qualit&eacute;s suivantes&nbsp;:</li>\r\n    </ul>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &nbsp;&ecirc;tre de bonne moralit&eacute;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir un bon sens des relations humaines ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &ecirc;tre discret ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir un sens de l&rsquo;organisation et l&rsquo;esprit d&rsquo;analyse ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &ecirc;tre dynamique, rigoureux, disponible et ponctuel ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir le respect de la hi&eacute;rarchie.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>II. &nbsp;DUR&Eacute;E DU CONTRAT ET LIEU D&rsquo;EXERCICE DE LA FONCTION :</strong></p>\r\n    <p><strong><em>&nbsp;</em></strong></p>\r\n    <p>La dur&eacute;e du contrat est de **** mois . Le candidat doit s&rsquo;assurer de sa disponibilit&eacute; sur la p&eacute;riode indiqu&eacute;e.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>III. &nbsp; DOSSIER DE CANDIDATURE</strong></p>\r\n    <p style=\"text-align: justify;\">&nbsp;Les candidats devront s&rsquo;inscrire sur le site de recrutement en ligne de l&rsquo;INS &agrave; l&rsquo;adresse suivante : ***********************</p>\r\n    <p style=\"text-align: justify;\">&nbsp;Le dossier de candidature devra &ecirc;tre t&eacute;l&eacute;charg&eacute; sur le site de recrutement et comprendra les documents suivants :</p>\r\n    <ul>\r\n        <li>Un curriculum vitae faisant ressortir la qualification et l&rsquo;exp&eacute;rience professionnelle de l&rsquo;int&eacute;ress&eacute; (format PDF)&nbsp;;</li>\r\n        <li>Une photocopie du dipl&ocirc;me (format PDF ou JPG)&nbsp;;</li>\r\n        <li>Une photocopie d&rsquo;une pi&egrave;ce d&rsquo;identit&eacute; (format PDF ou JPG)&nbsp;;</li>\r\n        <li>Une photo d&rsquo;identit&eacute; (JPG)&nbsp;;</li>\r\n    </ul>\r\n    <p>&nbsp;</p>\r\n    <p><strong>N.B&nbsp;: Taille des fichiers&nbsp;: Maximum 2 Mo.</strong></p>\r\n    <p>&nbsp;</p>\r\n    <p>&nbsp;<strong>IV. DATE D&rsquo;INSCRIPTION SUR LE SITE DE RECRUTEMENT</strong></p>\r\n    <p>Les dossiers de candidature doivent &ecirc;tre post&eacute;s sur le site de recrutement du <strong>****************</strong>, &agrave; minuit d&eacute;lai de rigueur. L&rsquo;heure de l&rsquo;enregistrement sur le site faisant foi.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>NB: Seuls les candidats pr&eacute;s&eacute;lectionn&eacute;s seront contact&eacute;s</strong>.</p>\r\n    <p>&nbsp;</p>\r\n</body>\r\n\r\n</html>', 'CARTOGRAPHE', '15', '<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">REPUBLIQUE DE GUINEE</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">MINISTERE DU PLAN ET DE LA COOPERATION INTERNATIONALE&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\"><img src=\"data:image/png;base64,\" width=\"606\" height=\"80\"></span><br></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><span style=\"font-family: -webkit-standard, serif;color: black;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></strong><em><span style=\"font-family: -webkit-standard, serif;color: black;\"></span></em></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">AVIS DE RECRUTEMENT DES AGENTS DE TERRAIN DE LA CARTOGRAPHIE PILOTE</span></u></strong></p>\r\n\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Dans le cadre du quatrième Recensement Général de la Population et de l’Habitation (RGPH-4), l’Institut National de la Statistique, à travers le Bureau Central du Recensement (BCR), recrute trente-deux (32) agents de collecte, en vue de la réalisation de la cartographie censitaire pilote. \r\nLa collecte des données de la cartographie censitaire pilote se déroulera dans les sous-préfectures et communes urbaines suivantes :\r\n</span></p>\r\n<ul style=\"list-style-type: undefined;margin-left:44px;\">\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	commune urbaine de Matam (Conakry) ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	commune urbaine de Koubia (Koubia) ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	sous-préfecture de Kiniero (Kouroussa) ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	sous-préfecture de Fangamandou (Gueckedou) ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	sous-préfecture de Koba (Boffa).</span></li>\r\n    \r\n</ul>\r\n<br>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">1- MISSIONS :</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Les travaux de la cartographie de terrain est une phase importante dans la r&eacute;alisation de la cartographie censitaire digitale. Le personnel en charge de ces travaux aura pour mission&nbsp;:</span></p>\r\n\r\n<ul style=\"list-style-type: undefined;margin-left:44px;\">\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	contacter les autorités administratives et locales et les informer de l’opération de la cartographie censitaire et obtenir leur coopération ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- mettre &agrave; jour les fonds de cartes (limite administrative, r&eacute;seau routier, hydrographique, &hellip;) ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- v&eacute;rifier et actualiser au besoin le fichier de localit&eacute;&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- administrer le questionnaire communautaire au chef de village et de quartier&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- procéder aux levés des coordonnées géographiques des principaux repères de la localité ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	procéder aux levés des coordonnées géographiques des limites des secteurs, quartiers avec les autorités locales ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	collecter les données avec la fiche des infrastructures et procéder aux levés des coordonnées géographiques des infrastructures socio-collectifs de base ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	identifier et géolocaliser toutes les concessions dans chaque ilot et localité ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	procéder au dénombrement exhaustif des concessions, ménages et individus dans chaque ilot avec la fiche de dénombrement ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	proposer un découpage des communes et des sous-préfectures en ZD sur la carte papier ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	proposer la composition des ZD sur tablette ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	transférer les données collectées au serveur central suivant de protocole de transfert de donnée qui sera défini ;</span></li>\r\n</ul>\r\n\r\n<br>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">2- PROFIL DU CANDIDAT :</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\"></span></p>\r\n\r\n<ul style=\"list-style-type: disc;margin-left:44px;\">\r\n    <li><span lang=\"ZH-CN\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre de nationalit&eacute; guin&eacute;enne ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre &acirc;g&eacute; de 18 ans au minimum et de 45 ans au maximum, au moment du d&eacute;p&ocirc;t du dossier de candidature&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- avoir un niveau d\'étude minimum de BAC+2 ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre en bonne sant&eacute; physique, mentale et intellectuelle&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre capable de travailler en &eacute;quipe et sous pression&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- avoir des aptitudes &agrave; communiquer couramment en fran&ccedil;ais et au moins dans une langue locale des zones choisies ;&nbsp;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre de bonne moralit&eacute;&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- avoir un bon sens des relations humaines ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- avoir le respect du secret professionnel ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- avoir un sens de l&rsquo;organisation et l&rsquo;esprit d&rsquo;analyse&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre dynamique, rigoureux, disponible et ponctuel ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre capable et disponible de travailler en milieu rural sous diff&eacute;rentes intemp&eacute;ries ;</span></li>\r\n<li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- savoir conduit une moto est un atout ;</span></li>\r\n<li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- avoir la maitrise dans d\'utilisation des tablettes et smartphone pour la collecte des données est un atout ;</span></li>\r\n\r\n <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre capable de r&eacute;diger un rapport.</span></li>\r\n</ul>\r\n\r\n<br>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">3- DOSSIER DE CANDIDATURE :</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Le dossier de candidature comprend une photo d\'identité, une copie de la Carte Nationale d’Identité (CNI) ou une copie du passeport ou une copie de l\'Attestation d’identité ou une copie du Permis de conduire, une copie du dernier diplôme, Pièce d’identité de la personne garante, une copie du curriculum vitae (CV),une copie du Certificat de Résidence. </span></p>\r\n\r\n\r\n<br>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">4- DATE ET LIEU DE DEPÔT DES DOSSIERS DE CANDIDATURES :</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\"></span></p>\r\n\r\n\r\n\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Le dossier de candidature devra &ecirc;tre scann&eacute; et envoy&eacute; sur le site de recrutement en ligne du <strong>RGPH-4</strong> &agrave; l&apos;adresse suivante :&nbsp;</span><span style=\"color: black;\"><a href=\"https://rgph.gov.gn\"><span style=\"font-family: Arial, sans-serif;color: blue;\">https://rgph.gov.gn</span></a></span><span style=\"font-family: Arial, sans-serif;color: rgb(46, 116, 181);\">&nbsp;.&nbsp;</span><span style=\"font-family: Arial, sans-serif;color: black;\">La date limite du d&eacute;p&ocirc;t des dossiers est fix&eacute;e au <strong> <span style=\"color: black; font-weight:bold\"><span style=\"font-family: Arial, sans-serif;color: black;\">Samedi 22 Juillet 2023,</span> à 23 heures délai de rigueur.</strong> L&rsquo;heure de l&rsquo;enregistrement sur les sites faisant foi.</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Seuls les candidats pr&eacute;s&eacute;lectionn&eacute;s seront contact&eacute;s</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">NB:  - L’INS N’EXIGE AUCUN FRAIS DE DOSSIER DE CANDIDATURE.\r\n</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;line-height: 24px;margin-left:30px;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">- POUR LES CANDIDATS QUI POSTULE DEPUIS L’INTERIEUR DU PAYS LES FRAIS DE TANSPORT VERS CONAKRY ET L’HEBERGEMENT NE SONT PAS PRIS EN CHARGE PAR INS.\r\n</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: 20px;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 500;text-align: start;text-indent: 0px;text-decoration: none;font-weight:bold;line-height: 30px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">Contacts: (+224) 612 127 503 / (+224) 612 127 502 / (+224) 612 127 504</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">\r\n  <br>\r\n</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Madame, Monsieur,</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">\r\n  <br>\r\n</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Je soussigné(e) Madame/Mademoiselle/Monsieur (<em>prénom nom)</em>, atteste sur l\'honneur que je ne souffre d’aucune maladie invalidante qui pourrait entraver le travail durant 30 jours à compter du premier jour.</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left:0cm;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Les sanctions encourues sont&nbsp;:</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>arrêt immédiat du travail, donc &nbsp;la rupture de contrat ;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>remboursement des jours de travail non effectués&nbsp;;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>remboursement des frais de transport et de formation.</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left:0cm;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">J\'ai pris connaissance des sanctions encourues.&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Fait pour servir et valoir ce que de droit.&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><em>&nbsp;</em></p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><em>(lieu), la (date)&nbsp;</em></p>', 0, 601, 500);
INSERT INTO `recrut_projet` (`id`, `Codeprojet`, `NomProjet`, `SigleProjet`, `Datedebut`, `Datefin`, `ChefProjet`, `Contact1chefprojet`, `Contact2chefprojet`, `Emailchefprojet`, `id_nivo_minimum`, `libelle_nivo_minimum`, `active`, `description`, `type_projet`, `piece_fourni`, `titre_poste`, `nbrdisponible`, `contrat`, `attestationhonneur`, `is_collecte`, `nbrinsert`, `nbr_limit`) VALUES
(9, 'AR', 'RGPH 4 - AGENT DE COLLECTE', 'RGPH4', '16-07-2023', '2024-08-22', 'GUINEE', '22334455', '', 0, 4, 'BAC +2', 1, '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n  <p style=\"text-align: justify;\">Dans le cadre de la r&eacute;alisation des activit&eacute;s de terrain de la cartographie censitaire du Recensement G&eacute;n&eacute;ral de la Population et de l&rsquo;Habitat (2023), l&lsquo;Institut National de la Statistique (INS) de Guinée recrute <strong>********</strong> <strong>****</strong> (<strong>****</strong>) <strong>************ agents de collecte.</strong></p>\r\n</body>\r\n</html>', 1, '<div class=\"ql-editor ql-blank\" data-gramm=\"false\" contenteditable=\"true\"><p><br></p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" rel=\"noopener noreferrer\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>', 'AGENT DE RECENSEUR', '15', '<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">REPUBLIQUE DE GUINEE</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">MINISTERE DU PLAN ET DE LA COOPERATION INTERNATIONALE&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\"><img src=\"data:image/png;base64,\" width=\"606\" height=\"80\"></span><br></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><span style=\"font-family: -webkit-standard, serif;color: black;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></strong><em><span style=\"font-family: -webkit-standard, serif;color: black;\"></span></em></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">AVIS DE RECRUTEMENT DES AGENTS DE TERRAIN DE LA CARTOGRAPHIE PILOTE</span></u></strong></p>\r\n\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Dans le cadre du quatrième Recensement Général de la Population et de l’Habitation (RGPH-4), l’Institut National de la Statistique, à travers le Bureau Central du Recensement (BCR), recrute trente-huit (38) agents de collecte, en vue de la réalisation de la cartographie censitaire pilote. \r\nLa collecte des données de la cartographie censitaire pilote se déroulera dans les sous-préfectures et communes urbaines suivantes :\r\n</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Commune urbaine de Matam (Conakry) ;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Commune urbaine de Koubia (Koubia) ;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Sous-préfecture de Kiniero (Kouroussa) ;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Sous-préfecture de Fangamandou (Gueckedou) ;&nbsp;&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Sous-préfecture de Koba (Boffa). &nbsp;&nbsp;</span></p>\r\n<br>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">1- MISSIONS :</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Les travaux de la cartographie de terrain est une phase importante dans la r&eacute;alisation de la cartographie censitaire digitale. Le personnel en charge de ces travaux aura pour mission&nbsp;:</span></p>\r\n\r\n<ul style=\"list-style-type: undefined;margin-left:44px;\">\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	contacter les autorités administratives et locales et les informer de l’opération de la cartographie censitaire et obtenir leur coopération ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- mettre &agrave; jour les fonds de cartes (limite administrative, r&eacute;seau routier, hydrographique, &hellip;) ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- v&eacute;rifier et actualiser au besoin le fichier de localit&eacute;&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- administrer le questionnaire communautaire au chef de village et de quartier&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- procéder aux levés des coordonnées géographiques des principaux repères de la localité ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	procéder aux levés des coordonnées géographiques des limites des secteurs, quartiers avec les autorités locales ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	collecter les données avec la fiche des infrastructures et procéder aux levés des coordonnées géographiques des infrastructures socio-collectifs de base ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	identifier et géolocaliser toutes les concessions dans chaque ilot et localité ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	procéder au dénombrement exhaustif des concessions, ménages et individus dans chaque ilot avec la fiche de dénombrement ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	proposer un découpage des communes et des sous-préfectures en ZD sur la carte papier ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	proposer la composition des ZD sur tablette ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">-	transférer les données collectées au serveur central suivant de protocole de transfert de donnée qui sera défini ;</span></li>\r\n</ul>\r\n\r\n<br>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">2- PROFIL DU CANDIDAT :</span></u></strong></p>\r\n\r\n\r\n<ul style=\"list-style-type: disc;margin-left:72.05px;\">\r\n    <li><span lang=\"ZH-CN\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre de nationalit&eacute; guin&eacute;enne ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre &acirc;g&eacute; de 18 ans au minimum et de 45 ans au maximum, au moment du d&eacute;p&ocirc;t du dossier de candidature&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- avoir un niveau minimum de BAC+2 ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre en bonne sant&eacute; physique, mentale et intellectuelle&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre capable de travailler en &eacute;quipe et sous pression&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- avoir des aptitudes &agrave; communiquer couramment en fran&ccedil;ais et au moins dans une langue locale des zones choisies ;&nbsp;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre de bonne moralit&eacute;&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- avoir un bon sens des relations humaines ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- avoir le respect du secret professionnel ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- avoir un sens de l&rsquo;organisation et l&rsquo;esprit d&rsquo;analyse&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre dynamique, rigoureux, disponible et ponctuel ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre capable et disponible de travailler en milieu rural sous diff&eacute;rentes intemp&eacute;ries;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">- &ecirc;tre capable de r&eacute;diger un rapport.</span></li>\r\n</ul>\r\n\r\n<br>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">3- DOSSIER DE CANDIDATURE :</span></u></strong></p>\r\n\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Le dossier de candidature comprend une copie du diplôme, une copie du passeport ou de la carte d’identité nationale, une copie de l’extrait d’acte de naissance et un certificat de résidence.</span></p>\r\n\r\n\r\n\r\n\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">4- DATE ET LIEU DE DEPÔT DES DOSSIERS DE CANDIDATURES :</span></u></strong></p>\r\n\r\n\r\n\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Le dossier de candidature devra &ecirc;tre scann&eacute; et envoy&eacute; sur le site de recrutement en ligne du <strong>RGPH-4</strong> &agrave; l&apos;adresse suivante :&nbsp;</span><span style=\"color: black;\"><a href=\"https://rgph.gov.gn\"><span style=\"font-family: Arial, sans-serif;color: blue;\">https://rgph.gov.gn</span></a></span><span style=\"font-family: Arial, sans-serif;color: rgb(46, 116, 181);\">&nbsp;.&nbsp;</span><span style=\"font-family: Arial, sans-serif;color: black;\">La date limite du d&eacute;p&ocirc;t des dossiers est fix&eacute;e au<strong> lundi 17 Juillet 2023, à 23 heures délai de rigueur.</strong> L&rsquo;heure de l&rsquo;enregistrement sur les sites faisant foi.</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Seuls les candidats pr&eacute;s&eacute;lectionn&eacute;s seront contact&eacute;s</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">NB: AUCUN FRAIS DE DOSSIERS N&rsquo;EST EXIGE</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">Contacts: +(224) 627 876 021 / +(224) 661 311 175 / +(224) 629 086 653</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>', '<p style=\'margin: 0cm 0cm 10pt; font-size: medium; font-family: \"Times New Roman\", serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-style: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; line-height: 12.65pt; \'><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">Madame, Monsieur,</span></p>\r\n<p style=\'margin: 0cm 0cm 10pt; font-size: medium; font-family: \"Times New Roman\", serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-style: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; line-height: 12.65pt;\'><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">&nbsp;</span></p>\r\n<p style=\'margin: 0cm 0cm 10pt; font-size: medium; font-family: \"Times New Roman\", serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-style: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; line-height: 12.65pt;\'><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">Je soussign&eacute;(e) Madame/Mademoiselle/Monsieur (<em><span style=\"font-family: Calibri, sans-serif;\">pr&eacute;nom nom)</span></em>, atteste sur l&apos;honneur que je ne souffre d&rsquo;aucune maladie invalidante qui pourrait entraver le travail durant 30 jours &agrave; compter du premier jour.</span></p>\r\n<p style=\'margin: 0cm; font-size: medium; font-family: \"Times New Roman\", serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-style: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none;\'><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">Les sanctions encourues sont&nbsp;:</span></p>\r\n<p style=\'margin: 0cm 0cm 0cm 33pt; font-size: medium; font-family: \"Times New Roman\", serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-style: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; text-indent: -18pt;\'><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">-</span><span style=\"font-size: 7pt; color: black;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">arr&ecirc;t imm&eacute;diat du travail, donc &nbsp;la rupture de contrat ;</span></p>\r\n<p style=\'margin: 0cm 0cm 0cm 33pt; font-size: medium; font-family: \"Times New Roman\", serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-style: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; text-indent: -18pt; \'><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">-</span><span style=\"font-size: 7pt; color: black;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">remboursement des jours de travail non effectu&eacute;s&nbsp;;</span></p>\r\n<p style=\'margin: 0cm 0cm 0cm 33pt; font-size: medium; font-family: \"Times New Roman\", serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-style: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; text-indent: -18pt;\'><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">-</span><span style=\"font-size: 7pt; color: black;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">remboursement des frais de transport et de formation.</span></p>\r\n<p style=\'margin: 0cm 0cm 0cm 33pt; font-size: medium; font-family: \"Times New Roman\", serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-style: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; \'><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">&nbsp;</span></p>\r\n<p style=\'margin: 0cm; font-size: medium; font-family: \"Times New Roman\", serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-style: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; \'><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">J&apos;ai pris connaissance des sanctions encourues.&nbsp;</span></p>\r\n<p style=\'margin: 0cm 0cm 10pt; font-size: medium; font-family: \"Times New Roman\", serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-style: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; line-height: 12.65pt;\'><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">&nbsp;</span></p>\r\n<p style=\'margin: 0cm 0cm 10pt; font-size: medium; font-family: \"Times New Roman\", serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-style: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; line-height: 12.65pt; \'><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">Fait pour servir et valoir ce que de droit.&nbsp;</span></p>\r\n<p style=\'margin: 0cm 0cm 10pt; font-size: medium; font-family: \"Times New Roman\", serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-style: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; line-height: 12.65pt;\'><em><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">&nbsp;</span></em></p>\r\n<p style=\'margin: 0cm 0cm 10pt; font-size: medium; font-family: \"Times New Roman\", serif; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-style: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; text-decoration: none; line-height: 12.65pt; \'><em><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\">(lieu), la<span class=\"Apple-converted-space\">&nbsp;</span> (date)&nbsp;</span></em><span style=\"font-size: 11.5pt; font-family: Calibri, sans-serif; color: black;\"></span></p>', 2, 0, 500);
INSERT INTO `recrut_projet` (`id`, `Codeprojet`, `NomProjet`, `SigleProjet`, `Datedebut`, `Datefin`, `ChefProjet`, `Contact1chefprojet`, `Contact2chefprojet`, `Emailchefprojet`, `id_nivo_minimum`, `libelle_nivo_minimum`, `active`, `description`, `type_projet`, `piece_fourni`, `titre_poste`, `nbrdisponible`, `contrat`, `attestationhonneur`, `is_collecte`, `nbrinsert`, `nbr_limit`) VALUES
(11, 'TIC', 'RGPH 4 - ASSISTANT TIC', 'RGPH4', '16-07-2023', '2024-08-22', 'GUINEE', '22334455', '', 0, 11, 'BAC +2', 1, '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n  <p style=\"text-align: justify;\">Dans le cadre de la r&eacute;alisation des activit&eacute;s de terrain de la cartographie censitaire du Recensement G&eacute;n&eacute;ral de la Population et de l&rsquo;Habitat (2023), l&lsquo;Institut National de la Statistique (INS) de Guinée recrute <strong>********</strong> <strong>****</strong> (<strong>****</strong>) <strong> Agents TIC</strong></p>\r\n</body>\r\n</html>', 1, '<!DOCTYPE html>\r\n<html>\r\n\r\n<head>\r\n    <title></title>\r\n</head>\r\n\r\n<body>\r\n    <p><strong>&nbsp;I. PROFIL DU CANDIDAT AUX POSTES</strong></p>\r\n    <p><strong>&nbsp;</strong></p>\r\n    <ul>\r\n        <li>&ecirc;tre Guin&eacute;en ;</li>\r\n        <li>&ecirc;tre &acirc;g&eacute; de 18 ans au minimum et de 45 ans au maximum, au moment du d&eacute;p&ocirc;t du dossier de candidature&nbsp;;</li>\r\n        <li>avoir un niveau minimum de la classe de Terminal dans l&rsquo;enseignement g&eacute;n&eacute;ral ou technique&nbsp;;</li>\r\n        <li>savoir utiliser une tablette informatique&nbsp;;</li>\r\n        <li>&ecirc;tre en bonne sant&eacute; physique, mentale et intellectuelle&nbsp;;</li>\r\n        <li>&ecirc;tre capable de travailler en &eacute;quipe et sous pression&nbsp;;</li>\r\n        <li>avoir une exp&eacute;rience en collecte de donn&eacute;es est un atout&nbsp;;</li>\r\n        <li>savoir aller &agrave; mobylette est obligatoire&nbsp;;</li>\r\n        <li>Avoir des aptitudes &agrave; communiquer ;&nbsp;</li>\r\n        <li>Avoir une connaissance des langues locales serait un atout&nbsp;;</li>\r\n        <li>Avoir un compte mobile money (MTN, Orange) ;</li>\r\n        <li>poss&eacute;der les qualit&eacute;s suivantes&nbsp;:</li>\r\n    </ul>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &nbsp;&ecirc;tre de bonne moralit&eacute;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir un bon sens des relations humaines ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &ecirc;tre discret ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir un sens de l&rsquo;organisation et l&rsquo;esprit d&rsquo;analyse ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &ecirc;tre dynamique, rigoureux, disponible et ponctuel ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir le respect de la hi&eacute;rarchie.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>II. &nbsp;DUR&Eacute;E DU CONTRAT ET LIEU D&rsquo;EXERCICE DE LA FONCTION :</strong></p>\r\n    <p><strong><em>&nbsp;</em></strong></p>\r\n    <p>La dur&eacute;e du contrat est de **** mois . Le candidat doit s&rsquo;assurer de sa disponibilit&eacute; sur la p&eacute;riode indiqu&eacute;e.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>III. &nbsp; DOSSIER DE CANDIDATURE</strong></p>\r\n    <p style=\"text-align: justify;\">&nbsp;Les candidats devront s&rsquo;inscrire sur le site de recrutement en ligne de l&rsquo;INS &agrave; l&rsquo;adresse suivante : ***********************</p>\r\n    <p style=\"text-align: justify;\">&nbsp;Le dossier de candidature devra &ecirc;tre t&eacute;l&eacute;charg&eacute; sur le site de recrutement et comprendra les documents suivants :</p>\r\n    <ul>\r\n        <li>Un curriculum vitae faisant ressortir la qualification et l&rsquo;exp&eacute;rience professionnelle de l&rsquo;int&eacute;ress&eacute; (format PDF)&nbsp;;</li>\r\n        <li>Une photocopie du dipl&ocirc;me (format PDF ou JPG)&nbsp;;</li>\r\n        <li>Une photocopie d&rsquo;une pi&egrave;ce d&rsquo;identit&eacute; (format PDF ou JPG)&nbsp;;</li>\r\n        <li>Une photo d&rsquo;identit&eacute; (JPG)&nbsp;;</li>\r\n    </ul>\r\n    <p>&nbsp;</p>\r\n    <p><strong>N.B&nbsp;: Taille des fichiers&nbsp;: Maximum 2 Mo.</strong></p>\r\n    <p>&nbsp;</p>\r\n    <p>&nbsp;<strong>IV. DATE D&rsquo;INSCRIPTION SUR LE SITE DE RECRUTEMENT</strong></p>\r\n    <p>Les dossiers de candidature doivent &ecirc;tre post&eacute;s sur le site de recrutement du <strong>****************</strong>, &agrave; minuit d&eacute;lai de rigueur. L&rsquo;heure de l&rsquo;enregistrement sur le site faisant foi.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>NB: Seuls les candidats pr&eacute;s&eacute;lectionn&eacute;s seront contact&eacute;s</strong>.</p>\r\n    <p>&nbsp;</p>\r\n</body>\r\n\r\n</html>', 'ASSISTANT TIC', '15', '<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">REPUBLIQUE DE GUINEE</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">MINISTERE DU PLAN ET DE LA COOPERATION INTERNATIONALE&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\"><img src=\"data:image/png;base64,\" width=\"606\" height=\"80\"></span><br></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><span style=\"font-family: -webkit-standard, serif;color: black;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></strong><em><span style=\"font-family: -webkit-standard, serif;color: black;\">Conakry, le</span></em></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">AVIS DE RECRUTEMENT DES AGENTS DE TERRAIN DE LA CARTOGRAPHIE PILOTE</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">Contexte&nbsp;</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">La mise en &oelig;uvre de la cartographie censitaire du RGPH-4 en R&eacute;publique de Guin&eacute;e n&eacute;cessite un personnel comp&eacute;tent de profil vari&eacute;. Ce personnel comprend, d&rsquo;une part le personnel d&rsquo;encadrement pour la conception m&eacute;thodologique, la coordination et le suivi des travaux et, d&rsquo;autre part, le personnel d&rsquo;ex&eacute;cution pour les travaux de laboratoire et le personnel du terrain. Pour avoir cet effectif n&eacute;cessaire, un recrutement par appel &agrave; candidature ouvert sera lanc&eacute;. Les candidats qui seront retenus seront form&eacute;s pour bien accomplir les missions qui leur seront assign&eacute;es</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Le personnel qui sera impliqu&eacute; dans les travaux de terrain sera class&eacute; en deux grandes cat&eacute;gories :</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Le personnel d&rsquo;encadrement de terrain</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Le personnel de collecte&nbsp;&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">Objectif de l&rsquo;activit&eacute;</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Les travaux de la cartographie de terrain est une phase importante dans la r&eacute;alisation de la cartographie censitaire digitale. Le personnel en charge de ces travaux aura pour mission&nbsp;:</span></p>\r\n<ul style=\"list-style-type: undefined;margin-left:44px;\">\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Contacter les autorit&eacute;s administratives et locales et les informer de l&rsquo;op&eacute;ration de la cartographie censitaire et obtenir leur coop&eacute;ration ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Mettre &agrave; jour les fonds de cartes (limite administratives, r&eacute;seau routier, hydrographique, &hellip;) ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">V&eacute;rifier et actualiser au besoin le fichier de localit&eacute;&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Administrer le questionnaire communautaire au chef de village et de quartier&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Proc&eacute;der aux lev&eacute;s des coordonn&eacute;es g&eacute;ographiques des localit&eacute;s et infrastructures socio-collectifs de base&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Identifier et g&eacute;olocaliser toutes les concessions dans chaque ilot et localit&eacute; ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Faire le listing des m&eacute;nages de chaque concession et estimer la population&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Proposer un d&eacute;coupage des communes/ sous-pr&eacute;fecture en ZD sur la carte papier&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Proposer la composition des ZD sur tablette&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Transf&eacute;rer les donn&eacute;es collect&eacute;es au serveur central suivant de protocole de transfert de donn&eacute;e qui sera d&eacute;fini.</span></li>\r\n</ul>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">Le personnel de collecte</span></u></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">Les chefs d&rsquo;&eacute;quipe</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Ce sont des responsables techniques en mati&egrave;re de collecte des donn&eacute;es cartographiques choisis en raison de leur connaissance du terrain. Ils disposeront, chacun d&rsquo;une tablette de haute capacit&eacute; sur laquelle des applications sp&eacute;cifiques seront d&eacute;velopp&eacute;es pour recevoir les donn&eacute;es de son &eacute;quipe et contr&ocirc;ler l&rsquo;exhaustivit&eacute; et d&rsquo;&eacute;dition primaire avant de transf&eacute;rer les donn&eacute;es collect&eacute;es au serveur central. Il aura en charge trois agents cartographes.&nbsp;&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">Agent cartographe&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Les agents cartographes travailleront sous la responsabilit&eacute; des chefs d&rsquo;&eacute;quipe. Ils sont le maillon essentiel de la chaine en termes de qualit&eacute; des donn&eacute;es collect&eacute;es.</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 13.8pt;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Dans le cadre de la r&eacute;alisation du Recensement G&eacute;n&eacute;ral de la Population et de l&rsquo;Habitat</span><span style=\"font-family: Arial, sans-serif;color: black;\">ion</span><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;(RGPH-4), l&lsquo;Institut National de la Statistique (INS) de Guin&eacute;e, &agrave; travers le Bureau Central du Recensement (BCR), recrute quarante-cinq (45) agents de collecte pour la cartographie pilote.</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 13.8pt;;\"><strong><span style=\'font-size:9px;font-family: \"Trebuchet MS\", sans-serif;color: black;\'>&nbsp;</span></strong></p>\r\n<ol start=\"1\" type=\"1\" style=\"margin-bottom: 0cm;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;margin-top: 0cm;\">\r\n    <li style=\'margin:0cm;font-size:16px;font-family:\"Calibri\",sans-serif;color:black;text-align:justify;line-height:150%;background:white;\'><strong><span style=\"font-family: Arial, sans-serif;\">PROFIL DU CANDIDAT</span></strong></li>\r\n</ol>\r\n<ul style=\"list-style-type: disc;margin-left:72.05px;\">\r\n    <li><span lang=\"ZH-CN\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre de nationalit&eacute; guin&eacute;enne ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre &acirc;g&eacute; de 18 ans au minimum et de 45 ans au maximum, au moment du d&eacute;p&ocirc;t du dossier de candidature&nbsp;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">BAC+3 ou plus dans les sp&eacute;cialit&eacute;s telles que la g&eacute;omatique, la cartographie, la g&eacute;ographie, l&rsquo;am&eacute;nagement du territoire ou toute autre sp&eacute;cialit&eacute; connexe mais avec une bonne exp&eacute;rience av&eacute;r&eacute;e dans les enqu&ecirc;tes statistiques.</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre en bonne sant&eacute; physique, mentale et intellectuelle&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre capable de travailler en &eacute;quipe et sous pression&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir des aptitudes &agrave; communiquer couramment en fran&ccedil;ais et au moins dans une langue locale ;&nbsp;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre de bonne moralit&eacute;&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir un bon sens des relations humaines ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir le respect du secret professionnel ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir un sens de l&rsquo;organisation et l&rsquo;esprit d&rsquo;analyse&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre dynamique, rigoureux, disponible et ponctuel ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre capable et disponible de travailler en milieu rural sous diff&eacute;rentes intemp&eacute;ries</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre capable de r&eacute;diger un rapport.</span></li>\r\n</ul>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<ol start=\"1\" type=\"1\" style=\"margin-bottom: 0cm;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;margin-top: 0cm;\">\r\n    <li style=\'margin:0cm;font-size:16px;font-family:\"Calibri\",sans-serif;color:black;line-height:150%;;\'><strong><span style=\"font-family: Arial, sans-serif;\">DATE ET LIEU DE DEP&Ocirc;T DES DOSSIERS DE CANDIDATURES&nbsp;</span></strong></li>\r\n</ol>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Le dossier de candidature devra &ecirc;tre scann&eacute; et envoy&eacute; sur le site de recrutement en ligne du <strong>RGPH-4</strong> &agrave; l&apos;adresse suivante :&nbsp;</span><span style=\"color: black;\"><a href=\"https://recrutement.rp2020.ci/\"><span style=\"font-family: Arial, sans-serif;color: blue;\">***************</span></a></span><span style=\"font-family: Arial, sans-serif;color: rgb(46, 116, 181);\">&nbsp;.&nbsp;</span><span style=\"font-family: Arial, sans-serif;color: black;\">La date limite du d&eacute;p&ocirc;t des dossiers est fix&eacute;e pour&nbsp;&nbsp;le&nbsp;<strong>***************, &agrave; minuit d&eacute;lai de rigueur.</strong> L&rsquo;heure de l&rsquo;enregistrement sur les sites faisant foi.</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Seuls les candidats pr&eacute;s&eacute;lectionn&eacute;s seront contact&eacute;s</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">NB: AUCUN FRAIS DE DOSSIERS N&rsquo;EST EXIGE</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">Contact: ***************</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">\r\n  <br>\r\n</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Madame, Monsieur,</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">\r\n  <br>\r\n</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Je soussigné(e) Madame/Mademoiselle/Monsieur (<em>prénom nom)</em>, atteste sur l\'honneur que je ne souffre d’aucune maladie invalidante qui pourrait entraver le travail durant 30 jours à compter du premier jour.</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left:0cm;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Les sanctions encourues sont&nbsp;:</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>arrêt immédiat du travail, donc &nbsp;la rupture de contrat ;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>remboursement des jours de travail non effectués&nbsp;;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>remboursement des frais de transport et de formation.</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left:0cm;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">J\'ai pris connaissance des sanctions encourues.&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Fait pour servir et valoir ce que de droit.&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><em>&nbsp;</em></p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><em>(lieu), le (date)&nbsp;</em></p>', 1, 0, 500);
INSERT INTO `recrut_projet` (`id`, `Codeprojet`, `NomProjet`, `SigleProjet`, `Datedebut`, `Datefin`, `ChefProjet`, `Contact1chefprojet`, `Contact2chefprojet`, `Emailchefprojet`, `id_nivo_minimum`, `libelle_nivo_minimum`, `active`, `description`, `type_projet`, `piece_fourni`, `titre_poste`, `nbrdisponible`, `contrat`, `attestationhonneur`, `is_collecte`, `nbrinsert`, `nbr_limit`) VALUES
(15, 'SUP', 'RGPH 4 - SUPERVISEUR', 'RGPH4', '16-07-2023', '2024-08-22', 'GUINEE', '22334455', '', 1, 13, 'BAC +2', 1, '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n  <p style=\"text-align: justify;\">Dans le cadre de la r&eacute;alisation des activit&eacute;s de terrain de la cartographie censitaire du Recensement G&eacute;n&eacute;ral de la Population et de l&rsquo;Habitat (2023), l&lsquo;Institut National de la Statistique (INS) de Guinée recrute <strong>********</strong> <strong>****</strong> (<strong>****</strong>) <strong> Superviseurs Terrains</strong></p>\r\n</body>\r\n</html>', 1, '<!DOCTYPE html>\r\n<html>\r\n\r\n<head>\r\n    <title></title>\r\n</head>\r\n\r\n<body>\r\n    <p><strong>&nbsp;I. PROFIL DU CANDIDAT AUX POSTES</strong></p>\r\n    <p><strong>&nbsp;</strong></p>\r\n    <ul>\r\n        <li>&ecirc;tre Guin&eacute;en ;</li>\r\n        <li>&ecirc;tre &acirc;g&eacute; de 18 ans au minimum et de 45 ans au maximum, au moment du d&eacute;p&ocirc;t du dossier de candidature&nbsp;;</li>\r\n        <li>avoir un niveau minimum de la classe de Terminal dans l&rsquo;enseignement g&eacute;n&eacute;ral ou technique&nbsp;;</li>\r\n        <li>savoir utiliser une tablette informatique&nbsp;;</li>\r\n        <li>&ecirc;tre en bonne sant&eacute; physique, mentale et intellectuelle&nbsp;;</li>\r\n        <li>&ecirc;tre capable de travailler en &eacute;quipe et sous pression&nbsp;;</li>\r\n        <li>avoir une exp&eacute;rience en collecte de donn&eacute;es est un atout&nbsp;;</li>\r\n        <li>savoir aller &agrave; mobylette est obligatoire&nbsp;;</li>\r\n        <li>Avoir des aptitudes &agrave; communiquer ;&nbsp;</li>\r\n        <li>Avoir une connaissance des langues locales serait un atout&nbsp;;</li>\r\n        <li>Avoir un compte mobile money (MTN, Orange) ;</li>\r\n        <li>poss&eacute;der les qualit&eacute;s suivantes&nbsp;:</li>\r\n    </ul>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &nbsp;&ecirc;tre de bonne moralit&eacute;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir un bon sens des relations humaines ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &ecirc;tre discret ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir un sens de l&rsquo;organisation et l&rsquo;esprit d&rsquo;analyse ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &ecirc;tre dynamique, rigoureux, disponible et ponctuel ;</p>\r\n    <p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- avoir le respect de la hi&eacute;rarchie.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>II. &nbsp;DUR&Eacute;E DU CONTRAT ET LIEU D&rsquo;EXERCICE DE LA FONCTION :</strong></p>\r\n    <p><strong><em>&nbsp;</em></strong></p>\r\n    <p>La dur&eacute;e du contrat est de **** mois . Le candidat doit s&rsquo;assurer de sa disponibilit&eacute; sur la p&eacute;riode indiqu&eacute;e.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>III. &nbsp; DOSSIER DE CANDIDATURE</strong></p>\r\n    <p style=\"text-align: justify;\">&nbsp;Les candidats devront s&rsquo;inscrire sur le site de recrutement en ligne de l&rsquo;INS &agrave; l&rsquo;adresse suivante : ***********************</p>\r\n    <p style=\"text-align: justify;\">&nbsp;Le dossier de candidature devra &ecirc;tre t&eacute;l&eacute;charg&eacute; sur le site de recrutement et comprendra les documents suivants :</p>\r\n    <ul>\r\n        <li>Un curriculum vitae faisant ressortir la qualification et l&rsquo;exp&eacute;rience professionnelle de l&rsquo;int&eacute;ress&eacute; (format PDF)&nbsp;;</li>\r\n        <li>Une photocopie du dipl&ocirc;me (format PDF ou JPG)&nbsp;;</li>\r\n        <li>Une photocopie d&rsquo;une pi&egrave;ce d&rsquo;identit&eacute; (format PDF ou JPG)&nbsp;;</li>\r\n        <li>Une photo d&rsquo;identit&eacute; (JPG)&nbsp;;</li>\r\n    </ul>\r\n    <p>&nbsp;</p>\r\n    <p><strong>N.B&nbsp;: Taille des fichiers&nbsp;: Maximum 2 Mo.</strong></p>\r\n    <p>&nbsp;</p>\r\n    <p>&nbsp;<strong>IV. DATE D&rsquo;INSCRIPTION SUR LE SITE DE RECRUTEMENT</strong></p>\r\n    <p>Les dossiers de candidature doivent &ecirc;tre post&eacute;s sur le site de recrutement du <strong>****************</strong>, &agrave; minuit d&eacute;lai de rigueur. L&rsquo;heure de l&rsquo;enregistrement sur le site faisant foi.</p>\r\n    <p>&nbsp;</p>\r\n    <p><strong>NB: Seuls les candidats pr&eacute;s&eacute;lectionn&eacute;s seront contact&eacute;s</strong>.</p>\r\n    <p>&nbsp;</p>\r\n</body>\r\n\r\n</html>', 'SUPERVISEUR', '15', '<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">REPUBLIQUE DE GUINEE</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">MINISTERE DU PLAN ET DE LA COOPERATION INTERNATIONALE&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\"><img src=\"data:image/png;base64,\" width=\"606\" height=\"80\"></span><br></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><span style=\"font-family: -webkit-standard, serif;color: black;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></strong><em><span style=\"font-family: -webkit-standard, serif;color: black;\">Conakry, le</span></em></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">AVIS DE RECRUTEMENT DES AGENTS DE TERRAIN DE LA CARTOGRAPHIE PILOTE</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">Contexte&nbsp;</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">La mise en &oelig;uvre de la cartographie censitaire du RGPH-4 en R&eacute;publique de Guin&eacute;e n&eacute;cessite un personnel comp&eacute;tent de profil vari&eacute;. Ce personnel comprend, d&rsquo;une part le personnel d&rsquo;encadrement pour la conception m&eacute;thodologique, la coordination et le suivi des travaux et, d&rsquo;autre part, le personnel d&rsquo;ex&eacute;cution pour les travaux de laboratoire et le personnel du terrain. Pour avoir cet effectif n&eacute;cessaire, un recrutement par appel &agrave; candidature ouvert sera lanc&eacute;. Les candidats qui seront retenus seront form&eacute;s pour bien accomplir les missions qui leur seront assign&eacute;es</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Le personnel qui sera impliqu&eacute; dans les travaux de terrain sera class&eacute; en deux grandes cat&eacute;gories :</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Le personnel d&rsquo;encadrement de terrain</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Le personnel de collecte&nbsp;&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">Objectif de l&rsquo;activit&eacute;</span></u></strong></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Les travaux de la cartographie de terrain est une phase importante dans la r&eacute;alisation de la cartographie censitaire digitale. Le personnel en charge de ces travaux aura pour mission&nbsp;:</span></p>\r\n<ul style=\"list-style-type: undefined;margin-left:44px;\">\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Contacter les autorit&eacute;s administratives et locales et les informer de l&rsquo;op&eacute;ration de la cartographie censitaire et obtenir leur coop&eacute;ration ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Mettre &agrave; jour les fonds de cartes (limite administratives, r&eacute;seau routier, hydrographique, &hellip;) ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">V&eacute;rifier et actualiser au besoin le fichier de localit&eacute;&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Administrer le questionnaire communautaire au chef de village et de quartier&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Proc&eacute;der aux lev&eacute;s des coordonn&eacute;es g&eacute;ographiques des localit&eacute;s et infrastructures socio-collectifs de base&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Identifier et g&eacute;olocaliser toutes les concessions dans chaque ilot et localit&eacute; ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Faire le listing des m&eacute;nages de chaque concession et estimer la population&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Proposer un d&eacute;coupage des communes/ sous-pr&eacute;fecture en ZD sur la carte papier&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Proposer la composition des ZD sur tablette&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">Transf&eacute;rer les donn&eacute;es collect&eacute;es au serveur central suivant de protocole de transfert de donn&eacute;e qui sera d&eacute;fini.</span></li>\r\n</ul>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><u><span style=\"font-family: Arial, sans-serif;color: black;\">Le personnel de collecte</span></u></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">Les chefs d&rsquo;&eacute;quipe</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Ce sont des responsables techniques en mati&egrave;re de collecte des donn&eacute;es cartographiques choisis en raison de leur connaissance du terrain. Ils disposeront, chacun d&rsquo;une tablette de haute capacit&eacute; sur laquelle des applications sp&eacute;cifiques seront d&eacute;velopp&eacute;es pour recevoir les donn&eacute;es de son &eacute;quipe et contr&ocirc;ler l&rsquo;exhaustivit&eacute; et d&rsquo;&eacute;dition primaire avant de transf&eacute;rer les donn&eacute;es collect&eacute;es au serveur central. Il aura en charge trois agents cartographes.&nbsp;&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">Agent cartographe&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Les agents cartographes travailleront sous la responsabilit&eacute; des chefs d&rsquo;&eacute;quipe. Ils sont le maillon essentiel de la chaine en termes de qualit&eacute; des donn&eacute;es collect&eacute;es.</span></p>\r\n<p style=\"margin: 0cm 0cm 7.5pt;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;;\"><span style=\"font-family: -webkit-standard, serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 13.8pt;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Dans le cadre de la r&eacute;alisation du Recensement G&eacute;n&eacute;ral de la Population et de l&rsquo;Habitat</span><span style=\"font-family: Arial, sans-serif;color: black;\">ion</span><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;(RGPH-4), l&lsquo;Institut National de la Statistique (INS) de Guin&eacute;e, &agrave; travers le Bureau Central du Recensement (BCR), recrute quarante-cinq (45) agents de collecte pour la cartographie pilote.</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 13.8pt;;\"><strong><span style=\'font-size:9px;font-family: \"Trebuchet MS\", sans-serif;color: black;\'>&nbsp;</span></strong></p>\r\n<ol start=\"1\" type=\"1\" style=\"margin-bottom: 0cm;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;margin-top: 0cm;\">\r\n    <li style=\'margin:0cm;font-size:16px;font-family:\"Calibri\",sans-serif;color:black;text-align:justify;line-height:150%;background:white;\'><strong><span style=\"font-family: Arial, sans-serif;\">PROFIL DU CANDIDAT</span></strong></li>\r\n</ol>\r\n<ul style=\"list-style-type: disc;margin-left:72.05px;\">\r\n    <li><span lang=\"ZH-CN\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre de nationalit&eacute; guin&eacute;enne ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre &acirc;g&eacute; de 18 ans au minimum et de 45 ans au maximum, au moment du d&eacute;p&ocirc;t du dossier de candidature&nbsp;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">BAC+3 ou plus dans les sp&eacute;cialit&eacute;s telles que la g&eacute;omatique, la cartographie, la g&eacute;ographie, l&rsquo;am&eacute;nagement du territoire ou toute autre sp&eacute;cialit&eacute; connexe mais avec une bonne exp&eacute;rience av&eacute;r&eacute;e dans les enqu&ecirc;tes statistiques.</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre en bonne sant&eacute; physique, mentale et intellectuelle&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre capable de travailler en &eacute;quipe et sous pression&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir des aptitudes &agrave; communiquer couramment en fran&ccedil;ais et au moins dans une langue locale ;&nbsp;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre de bonne moralit&eacute;&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir un bon sens des relations humaines ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir le respect du secret professionnel ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">avoir un sens de l&rsquo;organisation et l&rsquo;esprit d&rsquo;analyse&nbsp;;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre dynamique, rigoureux, disponible et ponctuel ;</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre capable et disponible de travailler en milieu rural sous diff&eacute;rentes intemp&eacute;ries</span></li>\r\n    <li><span lang=\"FR\" style=\"font-family: Arial, sans-serif;color: black;\">&ecirc;tre capable de r&eacute;diger un rapport.</span></li>\r\n</ul>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<ol start=\"1\" type=\"1\" style=\"margin-bottom: 0cm;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;margin-top: 0cm;\">\r\n    <li style=\'margin:0cm;font-size:16px;font-family:\"Calibri\",sans-serif;color:black;line-height:150%;;\'><strong><span style=\"font-family: Arial, sans-serif;\">DATE ET LIEU DE DEP&Ocirc;T DES DOSSIERS DE CANDIDATURES&nbsp;</span></strong></li>\r\n</ol>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Le dossier de candidature devra &ecirc;tre scann&eacute; et envoy&eacute; sur le site de recrutement en ligne du <strong>RGPH-4</strong> &agrave; l&apos;adresse suivante :&nbsp;</span><span style=\"color: black;\"><a href=\"https://recrutement.rp2020.ci/\"><span style=\"font-family: Arial, sans-serif;color: blue;\">***************</span></a></span><span style=\"font-family: Arial, sans-serif;color: rgb(46, 116, 181);\">&nbsp;.&nbsp;</span><span style=\"font-family: Arial, sans-serif;color: black;\">La date limite du d&eacute;p&ocirc;t des dossiers est fix&eacute;e pour&nbsp;&nbsp;le&nbsp;<strong>***************, &agrave; minuit d&eacute;lai de rigueur.</strong> L&rsquo;heure de l&rsquo;enregistrement sur les sites faisant foi.</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">Seuls les candidats pr&eacute;s&eacute;lectionn&eacute;s seront contact&eacute;s</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: center;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">NB: AUCUN FRAIS DE DOSSIERS N&rsquo;EST EXIGE</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-align: start;text-indent: 0px;text-decoration: none;line-height: 24px;;\"><strong><span style=\"font-family: Arial, sans-serif;color: black;\">Contact: ***************</span></strong></p>\r\n<p style=\"margin: 0cm;font-size: medium;font-family: Calibri, sans-serif;color: rgb(0, 0, 0);font-style: normal;font-weight: 400;text-indent: 0px;text-decoration: none;text-align: justify;line-height: 24px;;\"><span style=\"font-family: Arial, sans-serif;color: black;\">&nbsp;</span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">\r\n  <br>\r\n</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Madame, Monsieur,</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">\r\n  <br>\r\n</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Je soussigné(e) Madame/Mademoiselle/Monsieur (<em>prénom nom)</em>, atteste sur l\'honneur que je ne souffre d’aucune maladie invalidante qui pourrait entraver le travail durant 30 jours à compter du premier jour.</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left:0cm;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Les sanctions encourues sont&nbsp;:</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>arrêt immédiat du travail, donc &nbsp;la rupture de contrat ;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>remboursement des jours de travail non effectués&nbsp;;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;text-indent: -18pt;\">-<span style=\"font-size:9px;line-height: normal;font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>remboursement des frais de transport et de formation.</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left: 33pt;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom: 0.0001pt;margin-left:0cm;line-height: normal;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">J\'ai pris connaissance des sanctions encourues.&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">Fait pour servir et valoir ce que de droit.&nbsp;</p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><em>&nbsp;</em></p>\r\n<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;line-height: 16.866666793823242px;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><em>(lieu), le (date)&nbsp;</em></p>', 0, 0, 500);
